üå¥ I saw that written on the front of a notebook the other day & it reminded me of @disneyaulani, which is on Oahu. If I had a time machine, I would set it for September 2017 and go back to sitting in this chair & watching the sunset on this beach. Where would YOU go?
‚Ä¢
üèù Of course, I completely fell in love with Hawaii. It‚Äôs not just the humidity that wraps around you like a warm blanket; it‚Äôs the water and the flowers and the traditions and the delicious food and the amazing, kind people. This was a work trip, so it was a really fun & busy couple of days. And even thought it was a short trip, I grew so much during it. You see, this was my first time away from my whole family since I had kids. All of a sudden, for a few days, I wasn‚Äôt responsible for anyone other than me. I could go get coffee when I wanted to, go to bed when I wanted to, work out...I had so much freedom for the first time in almost a decade that it kind of freaked me out at first.
‚Ä¢
üå∏ But then, I began to remember who I was. Not just as a wife & a mom, but the me that I had been before I took on those roles. And as I journaled about what I was feeling, what kept coming up was that it was okay to take time for myself and not feel guilty. That it was not just okay, but necessary for me to find the time to pursue things simply because I loved doing them and they made my heart happy. I have forgotten this many times in the years since this picture was taken, but I remember it faster now, too.
‚Ä¢
‚ù§Ô∏è So, on this beautiful Friday, I am sending you ALL OF THE ALOHA and wishing you a happy Labor Day Weekend. And giving you this message: Your dreams matter. YOU matter. And you matter not because of what you do for others, but simply because you exist and deserve every good thing. Do not wait until your partner or children turn to you and say, ‚ÄúWhy don‚Äôt you go do that thing you‚Äôve wanted to do? We are good here for three hours or the next two days.‚Äù (As much as they love you, there‚Äôs a 90% chance that will not happen, at least not on a regular basis) Schedule the time, plan for the time (childcare plan, etc.), and when the time comes...GO.";}i:160;a:1:{s:14:"comments_count";i:14;}i:161;a:1:{s:11:"likes_count";i:73;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvBGKLlNBz";}i:163;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118773232_169265874677881_7753902226659234057_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=MCXQ4WKkLsIAX9Voh0p&oh=59dabe8b8134613b14d14addd981cc00&oe=5F7E3CA8";}i:164;a:1:{s:4:"type";s:7:"sidecar";}i:165;a:1:{s:8:"owner_id";i:400618735;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"";}i:169;a:1:{s:2:"id";s:19:"2391132299455788255";}i:170;a:1:{s:10:"short_code";s:11:"CEvAihYBnTf";}i:171;a:1:{s:12:"created_time";i:1599265235;}i:172;a:1:{s:7:"caption";s:462:"Each time we finish a project we celebrate with our trainees.  Graduation day is such a wonderful experience. It's a celebration that includes them, us, the community and our trainees smiles are wide as you can imagine! ‚Å†
